import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { TextField, Button, Typography, Box } from '@mui/material';
import {useNavigate} from 'react-router-dom'
import { login } from '../../features/User/UserSlice';

const LogIn = () => {
    let nav = useNavigate()
  const dispatch = useDispatch();
  const [formData, setFormData] = useState({ tz: '', name: '', password: '', telephone: '' ,address:''});
  const { loading, error } = useSelector((state) => state.users);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
      const result = await dispatch(login({ tz: formData.tz, password: formData.password }));
      if (result.meta.requestStatus === 'fulfilled') {
        nav('/usernav')
      }
    else {
      nav('/signin')
     
      }
    
  };
  


  return (
    <Box sx={{ maxWidth: 400, margin: 'auto', padding: 3, boxShadow: 3 }}>
      <Typography variant="h5" component="h2" gutterBottom>
        {isLogin ? 'Login' : 'Register'}
      </Typography>
      <form onSubmit={handleSubmit}>
        <TextField
          label="ID Number"
          variant="outlined"
          fullWidth
          name="tz"
          value={formData.tz}
          onChange={handleInputChange}
          margin="normal"
          required
        />
    
        <TextField
          label="Password"
          variant="outlined"
          fullWidth
          name="password"
          type="password"
          value={formData.password}
          onChange={handleInputChange}
          margin="normal"
          required
        />
        {error && <Typography color="error">{error}</Typography>}
        <Button variant="contained" color="primary" type="submit" fullWidth disabled={loading === 'loading'}>
        </Button>
      </form>
      <Button onClick={toggleMode} fullWidth>
        {isLogin ? "Don't have an account? Register" : 'Already have an account? Login'}
      </Button>
    </Box>
  );
};

export default LogIn;

